INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Mobiliario por Extravío', N'Se refiere a la baja de bienes muebles que han sido extraviados. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 2, 1, N'2024-11-22 17:11:06.330', N'2024-11-22 17:11:06.330');
