INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Mobiliario por Siniestro', N'Ocurre cuando los bienes son dados de baja debido a un siniestro. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 2, 1, N'2024-11-22 17:11:06.330', N'2024-11-22 17:11:06.330');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Mobiliario por Inservible', N'Este movimiento se utiliza cuando los bienes son dados de baja por estar inservibles. Este motivo del trámite no genera pólizas contables ni de depreciación.', 2, 1, N'2024-11-22 17:11:06.330', N'2024-11-22 17:11:06.330');
