INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Mobiliario por Donación', N'Se refiere a la baja de bienes muebles que han sido donados. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 2, 1, N'2024-11-22 17:11:06.330', N'2024-11-22 17:11:06.330');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Mobiliario por Duplicidad', N'Aplica cuando se detecta un registro duplicado de bienes muebles y se realiza la baja correspondiente. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 2, 1, N'2024-11-22 17:11:06.330', N'2024-11-22 17:11:06.330');
