INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Mobiliario por Término de Contrato', N'Ocurre cuando los bienes muebles son dados de baja al finalizar un contrato de arrendamiento u otro acuerdo. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 2, 1, N'2024-11-22 17:11:06.330', N'2024-11-22 17:11:06.330');
