INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Cambio de Centro de Costos', N'Este movimiento implica el cambio del centro de costos asignado a un bien mueble. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 4, 1, N'2024-11-22 17:12:09.640', N'2024-11-22 17:12:09.640');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Cambio de Resguardos de Mobiliario y Equipo', N'Aplica cuando se modifica el responsable o resguardante del mobiliario o equipo. Este motivo del trámite no genera póliza contable ni póliza de depreciación.', 4, 1, N'2024-11-22 17:12:09.640', N'2024-11-22 17:12:09.640');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Transferencia de Bienes Muebles', N'Ocurre cuando un bien mueble es transferido de una entidad o área a otra. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 4, 1, N'2024-11-22 17:12:09.640', N'2024-11-22 17:12:09.640');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Desincorporación de Bienes Muebles', N'Se refiere al proceso mediante el cual un bien mueble es dado de baja. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 5, 1, N'2024-11-22 17:12:58.020', N'2024-11-22 17:12:58.020');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Destrucción', N'Se refiere al proceso mediante el cual un bien mueble es destruido y dado de baja del inventario. Este motivo del trámite si genera póliza contable pero no se genera póliza de depreciación.', 6, 1, N'2024-11-22 17:13:41.073', N'2024-11-22 17:13:41.073');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Enajenación', N'Aplica cuando un bien mueble es vendido o transferido a un tercero, excluyendo el proceso de destrucción. Este motivo del trámite si genera póliza contable pero no se genera póliza de depreciación.', 6, 1, N'2024-11-22 17:13:41.073', N'2024-11-22 17:13:41.073');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Licitación en Oficialía de Maquinarias y Vehículos', N'Se refiere al alta de vehículos adquiridos mediante un proceso de licitación en la oficialía de maquinarias y vehículos. Este motivo del trámite no genera póliza contable, pero sí se genera póliza de depreciación.', 7, 1, N'2024-11-22 17:15:22.240', N'2024-11-22 17:15:22.240');
