INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Donación de Maquinaria y Vehículos', N'Se refiere al alta de vehículos recibidos como donación. Este motivo del trámite sí genera tanto póliza contable como póliza de depreciación.', 7, 1, N'2024-11-22 17:15:22.240', N'2024-11-22 17:15:22.240');
