INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Adjudicación por Embargo de Maquinaria y Vehículos', N'Se refiere al alta de vehículos obtenidos a través de un proceso de embargo. Este motivo del trámite sí genera tanto póliza contable como póliza de depreciación.', 7, 1, N'2024-11-22 17:15:22.240', N'2024-11-22 17:15:22.240');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta de Vehículos por Extinción', N'Aplica cuando los vehículos se dan de alta como resultado de la extinción de un fideicomiso o entidad. Este motivo del trámite sí genera tanto póliza contable como póliza de depreciación.', 7, 1, N'2024-11-22 17:15:22.240', N'2024-11-22 17:15:22.240');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta de Vehículos en Compensación', N'Se registra cuando un vehículo es dado de alta como compensación por otro bien. Este motivo del trámite sí genera tanto póliza contable como póliza de depreciación.', 7, 1, N'2024-11-22 17:15:22.240', N'2024-11-22 17:15:22.240');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos por Robo', N'Se refiere a la baja de un vehículo debido a que ha sido robado. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos por Siniestro', N'Aplica cuando un vehículo se da de baja debido a un siniestro. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos por Extravío', N'Se refiere a la baja de un vehículo que se ha extraviado. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos por Duplicidad', N'Se aplica cuando un vehículo se da de baja debido a que hay duplicidad en el registro. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos por Inservible', N'Aplica cuando un vehículo se considera inservible y se da de baja. Este motivo del trámite no genera ni póliza contable ni póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos Total', N'Se refiere a la baja total de un vehículo, independientemente de la causa. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos por Donación', N'Aplica cuando un vehículo se da de baja debido a una donación. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja de Vehículos por Motivos Extraordinarios', N'Se refiere a la baja de un vehículo por razones que no encajan en las categorías anteriores. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 8, 1, N'2024-11-22 17:19:35.567', N'2024-11-22 17:19:35.567');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Actualización de Datos de Bienes Vehículos', N'Se refiere a la actualización general de los datos registrados para los vehículos en el sistema. Este motivo del trámite no genera póliza contable ni póliza de depreciación.', 9, 1, N'2024-11-22 17:17:42.153', N'2024-11-22 17:17:42.153');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Actualización de Datos de la Factura de Bienes Vehículos', N'Incluye cambios en los datos de la factura asociada a los bienes vehículos, como ajustes en el precio. Este motivo del trámite si genera póliza contable sólo si se cambia el precio, pero no se genera póliza de depreciación.', 9, 1, N'2024-11-22 17:17:42.153', N'2024-11-22 17:17:42.153');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Actualización de Bienes Vehículos Incorporados del Sistema de Compras', N'Aplica a la actualización de datos para vehículos que ya han sido incorporados en el sistema de compras. Este motivo del trámite no genera póliza contable, pero sí se genera póliza de depreciación.', 9, 1, N'2024-11-22 17:17:42.153', N'2024-11-22 17:17:42.153');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Cambio de Centro de Costos', N'Se refiere al ajuste del centro de costos asociado a un vehículo. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 10, 1, N'2024-11-22 17:18:51.217', N'2024-11-22 17:18:51.217');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Transferencias', N'Aplica a los movimientos de vehículos entre diferentes ubicaciones o departamentos. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 10, 1, N'2024-11-22 17:18:51.217', N'2024-11-22 17:18:51.217');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Cambio de Resguardante', N'Se refiere al ajuste del responsable o resguardante de un vehículo. Este motivo del trámite no genera ni póliza contable ni póliza de depreciación.', 10, 1, N'2024-11-22 17:18:51.217', N'2024-11-22 17:18:51.217');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Desincorporación', N'Se refiere a la baja de un vehículo que se prepara para ir a Destino Final. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 11, 1, N'2024-11-22 17:20:52.397', N'2024-11-22 17:20:52.397');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Enajenación', N'Se refiere a la venta o transferencia de propiedad de un vehículo a una entidad externa. Este motivo del trámite si genera póliza contable y se genera póliza de depreciación.', 12, 1, N'2024-11-22 17:22:17.460', N'2024-11-22 17:22:17.460');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Destrucción', N'Aplica cuando un vehículo es destruido y dado de baja en los registros. Este motivo del trámite si genera póliza contable, pero no se genera póliza de depreciación.', 12, 1, N'2024-11-22 17:22:17.460', N'2024-11-22 17:22:17.460');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Inscripción Primitiva', N'Se refiere al registro inicial de un inmueble en el sistema. Este motivo del trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Donación', N'Aplica cuando un inmueble es recibido como donación. Este motivo del trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Compraventa', N'Se refiere al registro de un inmueble adquirido mediante compra. Este motivo de trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por División', N'Se aplica cuando un inmueble es registrado como resultado de una división de propiedades. Este motivo de trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Permuta', N'Se refiere al alta de un inmueble recibido a cambio de otro en una permuta. Este motivo del trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Adjudicación a Título Gratuito', N'Se aplica cuando un inmueble es adjudicado sin costo a la entidad. Este motivo del trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Compraventa Judicial', N'Se refiere a la compra de un inmueble mediante un proceso judicial. Este motivo del trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Alta por Expropiación', N'Se aplica cuando un inmueble es adquirido por expropiación. Este motivo del trámite si genera pólizas contables y pólizas de depreciación.', 13, 1, N'2024-11-22 17:23:34.067', N'2024-11-22 17:23:34.067');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Compraventa', N'Se refiere a la baja de inmuebles debido a una transacción de compraventa. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Donación', N'Aplica cuando el inmueble es dado de baja debido a una donación. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Unión', N'Incluye la baja de inmuebles debido a la unión de propiedades. Este motivo de trámite si generan pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Permuta', N'Se refiere a la baja de inmuebles como resultado de un intercambio o permuta. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Dación en Pago', N'Aplica cuando el inmueble se da de baja debido a una dación en pago. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Sentencia Judicial', N'Se refiere a la baja de inmuebles ordenada por una sentencia judicial. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Resolución Administrativa', N'Aplica cuando el inmueble se da de baja debido a una resolución administrativa. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Baja por Uso Común', N'Incluye la baja de inmuebles debido a su uso común o compartido. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 14, 1, N'2024-11-22 17:25:33.310', N'2024-11-22 17:25:33.310');
