INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Modificación por Mejoras de Construcción', N'Aplica a las mejoras realizadas en la construcción del inmueble. Este motivo de trámite si genera pólizas contables, pero no se generan pólizas de depreciación.', 15, 1, N'2024-11-22 17:24:45.463', N'2024-11-22 17:24:45.463');
INSERT INTO SICBA.Patrimonio.MotivosTramites (sNombre, sDescripcion, iIdTipoTramite, bActivo, dtFechaCreacion, dtFechaModificacion) VALUES (N'Modificación por Afectación', N'Incluye modificaciones relacionadas con la afectación del inmueble. Este motivo de trámite no se genera pólizas contables ni pólizas de depreciación.', 15, 1, N'2024-11-22 17:24:45.463', N'2024-11-22 17:24:45.463');
